}
#head .bdsug {
    background: #121216!important;
    border: none!important;
    box-shadow: 0 2px 2px rgba(0, 0, 0, .2)!important
}
#head .bdsug-feedback-wrap {
    background: #121216!important
}
#head .bdsub ul {
    background: #2b3a47;
    border: none!important;
    box-shadow: none!important
}
#head .bdsug li {
    color: #f1f1f1;
    height: 32px!important;
    font: 100 14px/32px"Microsoft YaHei"!important
}
#head .bdsug li:hover {
    background: #04040c
}
#head .bdsug li span {
    color: #ccc
}
#head .bdsug div[style] {
    background: #24303c!important;
    height: 32px;
    font: 100 12px/32px"Microsoft YaHei";
    background: none!important
}
#s_tab {
    border-bottom: none!important
}
#s_tab b {
    border-color: #1cacf4!important
}
#s_tab a,
#container .search_tool_tf,
#container .c-gap-left,
#container .search_tool_close,
#container .search_tool,
#help a {
    color: #ccc
}
#s_tab b,
#s_tab a:hover,
#container .search_tool_tf:hover,
#container .c-gap-left:hover,
#container .search_tool_close:hover,
#container .search_tool:hover,
#help a:hover {
    color: #1cacf4
}
#rs table a {
    color: #448cfc!important;
    opacity: .5!important;
    transition: opacity 2s
}
#rs table a:hover {
    opacity: 1!important;
    transition: opacity .15s
}
#foot {
    border-top: 1px solid rgba(137, 137, 137, .1)
}
#page strong .pc {
    background: #1cacf4!important
}
#page a {
    background: #1c1e24!important;
    color: #ccc
}
#page a:hover,
#page a .pc:hover,
#page .n:hover {
    color: #f1f1f1;
    background: #1cacf4!important;
    border-radius: 2px
}
.c-container {
    color: #b7b7b7;
    background: #121216!important
}
.c-container a {
    color: #1cacf4
}
.c-container em,
.c-container font {
    color: #dc043c
}
.f13 {
    margin-top: 8px
}
.c-container .OP_LOG_LINK {
    color: #f1f1f1!important;
    background: none!important;
    border: 1px solid #1cacf4;
    font-size: 12px!important
}
.c-container .OP_LOG_LINK:hover {
    background: #1cacf4!important;
    color: #fff!important
}
#content_left .result-op .c-border,
#content_left .result-op .op_dict3_extra {
    border-color: rgba(137, 137, 137, .1)!important
}
#content_left .result-op .c-border {
    background: none!important;
    border-top: 1px solid rgba(255, 255, 255, .1);
    border-bottom: 1px solid rgba(255, 255, 255, .1)
}
#content_left .result-op .op_dict3_extra {
    border-top: 1px solid rgba(255, 255, 255, .1);
    border: none!important
}
